import React, { useState } from "react";
import InputData from "./components/InputData";
import './index.css';
import InputTable from './components/InputTable';
import Card from './UI/Card';

const App = () => {

  const [testListUpdated, setTestListUpdated] = useState('');

  const testList = [{
    id: '0',
    date: 'Date',
    startWorkTime: 'Start Work Time',
    offWorkTime: 'Off Work Time',
    breakStart: 'Break Start',
    breakFinish: 'Break Finish',
    hours: 'Hours',
    salary: 'Salary'
  }];



  const addInputData = (acceptedInputDataObject) => {
    testList.push(acceptedInputDataObject);
    setTestListUpdated(testList);
    console.log(testList);
  };

  return (
    <Card>
    <InputData onAddInputData={addInputData}/>
    <InputTable dataList={testListUpdated} />
    </Card>
  );
}

export default App;
